script: |
  super -f text -I q7640.spq | sort > q7640.out

inputs:
  - name: q7640.spq
    data: |
      SELECT ALL col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col2 * - col1 IN ( - col2 * col1 + + cor0.col1 * - col1 );
  - name: tab0

outputs:
  - name: q7640.out
    data: |
      1
      33
      82
